int main() {
	int input;
	scanf("%d",&input);
	int x;
	x = input / 2;
	for (int i = 0; i < x; ++ i) {
		for (int j = 0; j < i; ++ j) {
			printf("*");
		}
		printf("\\");
		for (int k = 0; k < input - 2 * (i + 1) ; ++ k) {
			printf("+");
		}
		printf("/");
		for (int m = 0; m < i; ++ m) {
			printf("*");
		}
		printf("\n");
	}
	for (int i = 0; i < x; ++ i) {
		for (int j = 0; j < x - 1 - i; ++ j) {
			printf("*");
		}
		printf("/");
		for (int k = 0; k < 2 * i; ++ k) {
			printf("+");
		}
		printf("\\");
		for (int m = 0; m < x - 1 - i; ++ m) {
			printf("*");
		}
		printf("\n");
	}
	return 0;
}

