int atoi(const char array[]) {
	int res = 0;
	int nagative = 0;
	if (array[0] == '-')
		nagative = 1;
	for (int i = 0; array[i + nagative]; i++) {
		res *= 10;
		res += array[i + nagative] - '0';
	}
	if (nagative) return -res;
	else return res;
}
void decToHex(const char dec[], char hex[]) {
	int num = atoi(dec);
	int num2 = num;
	int digit = 0;//how many digits in num if it is transed to hex
	while (num2) {
		num2 = num2 / 16;
		digit++;
	}
	hex[digit] = 0;
	for (int i = digit - 1; i >= 0; i--) {
		if (num % 16 < 10)
			hex[i] = num % 16 + '0';
		else
			hex[i] = num % 16 - 10 + 'A';
		num /= 16;
	}
}

