int getMaxCuttingPrice(int prices[][2],int priceCount,int rodLength){
	int memory[1000] = {0};
	//prices[the 'i+1'th,共priceCount个]['0' is length,'1' is price]
	if(memory[rodLength] > 0){
		return memory[rodLength];
	}
	int maxprice = (rodLength <= 6 ? prices[rodLength - 1][1] : 0);
	for (int i = 0; i < priceCount-1; ++ i) {
		int len = i + 1;
		int price = getMaxCuttingPrice(prices,priceCount,len) + getMaxCuttingPrice(prices,priceCount,rodLength-len);
		maxprice = max(price,maxprice);
	}//for end.
	memory[rodLength] = maxprice;
	return maxprice;
}

